import React from "react";
import { Tile } from "../tile/Tile"


export const TileList = ({ tiles }) => {
  return (
    <div>
      {tiles.map((tile, index) => {
        const { name, contact, date, time } = tile;
        return (
          <>
            <Tile 
              key={index}
              name={name}
              contact={contact} 
              date
              />
          </>
        )
      })}

    </div>
  );
};
